const int maxVelocityEgo = 20;
const int maxVelocityFront = 20;
const int minVelocityEgo = -10;
const int minVelocityFront = -8;

const int radarRange = 200; /// maximum range radar can see

int distance = 10;           /// integer estimate of distance between cars

int velocityEgo;             /// integer estimate of Ego velocity
int[-2,2] accelerationEgo;   /// acceleration of Ego
broadcast chan chooseEgo;    /// signal to Ego to decide

int velocityFront;           /// integer estimate of Front velocity
int[-2,2] accelerationFront; /// acceleration of Front
broadcast chan chooseFront;  /// signal to Front to decide
broadcast chan update;       /// check if Front is still within radar range

/// Estimate velocities and distance using integers after 1s
void updateDiscrete() {
    int oldVel = velocityFront - velocityEgo;
    int newVel;
    velocityEgo = velocityEgo + accelerationEgo;
    velocityFront = velocityFront + accelerationFront;
    newVel = velocityFront - velocityEgo;
    if (distance <= radarRange)
        distance += (oldVel + newVel)/2;
    else
        distance = radarRange + 1;
}

/// Continuous (realistic) state of the system:
hybrid clock rVelocityEgo;   /// velocity of Ego
hybrid clock rVelocityFront; /// velocity of Front
hybrid clock rDistance = 10; /// distance between cars
hybrid clock D; /// "cost" of distance used in strategy optimization
clock C;

double relVelocity(double velFront, double velEgo, double dist) {
    if (dist <= radarRange)
        return velFront - velEgo;
    else
        return 0.0;
}

// shield stuff

import "/home/andreashhp/Documents/university/direc/stratetrees/experiments/automated/cruise/shields/shield.so" {
    int shield(double v_ego, double v_front, double distance);
};

bool shield_enabled = false;

int NOTHING = 0;
int BACK_ONLY = 1;
int BACK_NEUT = 2;
int BACK_NEUT_FORW = 3;

typedef struct {
    bool backwards;
    bool neutral;
    bool forwards;
} allowedActions;

allowedActions getAllowedActions(double v_ego, double v_front, double dist) {
    if (!shield_enabled) { 
        allowedActions allowed = { true, true, true };
        return allowed;
    } else {
        int decision = shield(v_ego, v_front, dist);
        allowedActions allowed = {
            (decision == 0 || decision >= BACK_ONLY),  // it is always allowed to go backwards
            (decision == 0 || decision >= BACK_NEUT),
            (decision == 0 || decision >= BACK_NEUT_FORW)
        };
        return allowed;
    }
} 

// allowedActions allowed = getAllowedActions(0.0, 0.0, 10.0);
allowedActions allowed = { true, false, false };
